import React from "react";
import './Slider.css';
import Slider from "react-slick";
import Slider1 from '../../../Assets/Images'

const HomeSlider =()=> {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };
    return (
        <section className="homeSlider">
            <div className="container-fluid">
                <Slider {...settings}>
                    <div className="item">

                    </div>
                </Slider>
            </div>
        </section>
    )
}
export default HomeSlider;
